import React, { useState, useEffect }from 'react';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import { Calendar, momentLocalizer} from 'react-big-calendar';
import moment from 'moment'
import '../index.css'


const CalendarBook = () => {
  const [events, setEvents] = useState([]);
  let todos;
  const localizer = momentLocalizer(moment);

          useEffect(() => {
            fetch('https://private-37dacc-cfcalendar.apiary-mock.com/mentors/1/agenda')
            .then(response => response.json())
            .then(data => 
              {
                let todos = data.mentor.name;
                console.log(data);
                document.title = `You clicked ${todos} times`;

              })
            // Update the document title using the browser API
          });

          console.log(todos);

  return (
  
 <div className="sampleBook">  
   <h2 className='text-center text-primary pb-3 pt-2'> Book A Mentor </h2>
 <Calendar
   localizer={localizer}
   events={events}
   startAccessor="start"
   endAccessor="end"
   style={{ height: 500 }}
 />
</div>
  )
}

export default CalendarBook;
